	public boolean parsedPointsContain(List<Point> list, Point point){
		for (int i = 0; i < list.size(); i++) {
			if (list.get(i).n == point.n && list.get(i).m == point.m){
				return true;
			}
		}
		
		return false;
		
	}
	
